(10, 'CP Benelux BV', '<h1>Transport:</h1>\r\n\r\n<p>meer dan ladingen vervoeren CP Benelux is specialist in het transport, de opslag en distributie van ADR-goederen. Onze opslagloodsen zijn volledig toegerust op veilige en verantwoorde op- en overslag van ADR-goederen. Ook onze medewerkers beschikken over de juiste kennis, ervaring en certificaten om met ADR-goederen te werken. Transport binnen Europa Met CP Benelux is elke Europese bestemming binnen handbereik. Of u nu een spoedlevering heeft, ADR goederen wilt vervoeren of een speciale lading wilt transporteren. Over de weg, over water of door de lucht. Betrouwbare partner in transport Kwaliteit voert bij ons de boventoon. De regie over het transport houden wij daarom geheel in eigen hand. Wij beschikken over eigen trucks, die volledig zijn toegerust op het vervoer van ADR goederen en het lossen en laden aan boord van schepen. Daarnaast hebben we een zorgvuldig netwerk opgebouwd met vervoerders in heel Europa. Dit in combinatie met onze jarenlange marktkennis en expertise binnen de CP Group maakt van ons een betrouwbare partner voor multimodaal transport in heel Europa.</p>\r\n', 'G.Burgerlaan 33', '3131 KZ', 'Vlaardingen', 'Zuid-Holland', '', '+31 (0) 10-2994999', 'nvt', '2, 3, 1, 1, 1, 1', ', ADR transport, Autotransport', 'Wegtransport', 'Europa', 'onbekend', 50, 'BV.', 'eur', '1-1-2099', 'order@cpgroup.nl', '0', '', '', '', 1, 'Transport'),
(11, 'Veldwerk Transport B.V.', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Het begin Het was ergens in het voorjaar van 1988 toen Koos van Velden, indertijd taxichauffeur, een passagier veilig en snel naar een opgegeven adres had gebracht en een toekomstplan kreeg: &ldquo;Ik ken het Westland op m&rsquo;n duimpje, vind autorijden leuk (het was toen ook nog niet zo druk in het verkeer) en service verlenen zit me in het bloed, weet je wat? Ik ga een koeriersbedrijfje beginnen!&rdquo; Dus zo gezegd, zo gedaan. Na grondig overleg met zijn vrouw Ella en de zaakjes berekend te hebben, bleek dat het haalbaar zou kunnen zijn. In mei van dat jaar kwam de eerste auto, een Volkswagen Golf. Het was een tweedehandsje en toen ze in juli 1992 met pensioen ging had ze er 292.000 kilometer op zitten. Natuurlijk kwamen er meer auto&rsquo;s bij, ook combo&rsquo;s en bussen en er werd zelfs naar vrachtauto&rsquo;s gekeken, want de klanten kwamen en ieder met eigen wensen. Veldwerk Koerier begon echt te groeien, dus verstandig investeren in mens en materieel was het credo.</p>\r\n', 'De Hondert Margen 16', '2678 AC', 'DE LIER', 'Zuid-holland', 'http://www.veldwerk.info/', '+31 (0) 174-441077', '+31 (0) 174-416889', '7, 11, 14, 5, 10, 12', 'Speciaal Transport, Warehousing, Sneltransport, Just in Time, High Value Transport, Palletdistrubuti', 'Wegtransport', 'Europa', 'onbekend', 30, 'BV.', 'eur', '1-1-2099', 'planning@veldwerk.info', 'gold', 'veldwerk banner.PNG', 'Logo Veldwerk.png', '', 1, 'Transport'),
