(479, 'Holland Parcel Express B.V.', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Holland Parcel Express (HPE) werd opgericht in 1980 als onafhankelijke koeriersservice. Sindsdien is de onderneming door haar ervaring en zeer hoge servicegraad uitgegroeid tot &eacute;&eacute;n van de meest&nbsp;betrouwbare allround koeriers in de regio Groot-Amsterdam. Het bedrijf is door haar gunstige ligging, nabij grote uitvalswegen zeer goed bereikbaar. HPE heeft een landelijke dekking en is door haar extensieve netwerk in staat ook internationaal te opereren.</p>\r\n\r\n<p>Voor elk logistiek probleem waar u tegenaan loopt, heeft HPE de oplossing. Of het nu gaat om een spoedbestelling, een zending naar hartje centrum of een combinatie van beide, wij lossen het graag voor u op. Ook goederen die gekoeld vervoerd dienen te worden, leveren wij op een temperatuur tot -18&deg;C en volgens strikte HACCP normering bij uw relatie af. Verder kunt u bij ons terecht voor bemiddeling bij de aanvraag van een reisvisum en de legalisatie van (handels)documenten. Zoekt u de oplossing voor uw logistieke uitdaging, neem dan gerust contact met ons op</p>\r\n', 'Sluispolderweg 4 D', '1505 HK', 'ZAANDAM', 'Noord-Holland', 'www.hpe.nl', '+31 (0) 75-6310901', '', '10, 16, 17, 21, 22, 24', 'Sneltransport, Economy Service, Overnight, Koel/Vries, Document Legalisatie, Visum Express Service', '', '', 'T. van Nieuwenhuizen', 6, 'B.V.', 'EUR', '', 'info@hpe.nl', 'gold', 'foto HPE.png', 'Logo HPE.png', '', 1, 'Transport'),
