(568, 'Luna Koeriers', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Luna Koeriers is een vertrouwde middelgrote koeriersdienst in Noord Holland. Onze organisatie heeft meer dan 30 jaar ervaring in het transportvak.</p>\r\n\r\n<p>Met ons wagenpark leveren we diensten in de regio, maar ook daarbuiten. Wij verzorgen onder andere sneltransporten door heel Europa.</p>\r\n\r\n<p>Voor zowel grote zendingen als kleine zendingen zijn wij uw partner in transport.</p>\r\n\r\n<p>Luna Koeriers biedt verschillende diensten aan zodat uw zending op de afgesproken tijd op de afgesproken plaats wordt afgeleverd.</p>\r\n\r\n<p>Naast het gevarieerde diensten aanbod heeft Luna Koeriers voor elk van uw transportvragen een antwoord. Door maatwerkoplossingen dragen wij, naar uw wensen, zorg&nbsp;voor uw zending.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Neutronweg 59', '1627 LG', 'HOORN', 'Noord-Holland', 'www.luna-koeriers.nl', '+31 (0) 229-213366', '+31 (0) 229-268807', '31, 25, 17, 15, 14, 1', ', Palletdistrubutie, Pakketdistributie, Overnight, Koeriersdienst, Spoedzendingen', '', '', '', 0, '', '', '', 'info@luna-koeriers.nl', 'gold', 'Banner Luna.JPG', 'logo-luna-koeriers.jpg', 'Foto Luna.jpg', 1, 'Transport'),
