(983, '0900koerier', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-family:trebuchet ms,helvetica,sans-serif">KCN Haarlem is een familiebedrijf. Eigenaren zijn Ron, Remco en Mark Jedema.<br />\r\nWij hebben meerdere chauffeurs in loondienst en verder werken we met een aantal oproepkrachten. Onze chauffeurs zijn allen representatief, aangezien ze uw bedrijf vertegenwoordigen tegenover uw klant.</span></p>\r\n\r\n<p><span style="font-family:trebuchet ms,helvetica,sans-serif">We hebben een NIWO transportvergunning voor binnenland en buitenland en we staan geregistreerd bij de Voedsel en Waren autoriteit.</span></p>\r\n\r\n<p><span style="font-family:trebuchet ms,helvetica,sans-serif">We zijn gevestigd in de Waarderpolder, om de hoek bij veel van onze klanten. Omdat we altijd veel op weg zijn, is de kans dat een auto bij u in de buurt is redelijk groot.<br />\r\nVandaar dat we binnen 30 minuten na uw opdracht al voor de deur staan.</span></p>\r\n', 'Drukkersweg 10', '2031 EE', 'HAARLEM', 'Noord-Holland', 'kcn-haarlem.nl', '0900-5637437', ' +31 (0) 23-5281252', '10, 17, 23, 30, 1, 1', ', Sneltransport, Overnight, Europa, Nederland', '', '', '', 0, '', '', '', 'planning@0900koerier.nl', 'gold', 'Banner logo.png', 'Logo 0900.png', 'foto2 0900.jpg', 1, 'Transport'),
