(1220, ' Koerier Centrum Haaglanden', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Koerier Centrum Haaglanden is<u> erkend koerier</u> en vervoert alle zendingen met NIWO vergunning&nbsp;incl. ADR (alle klassen),&nbsp;zoals&nbsp;de klant&nbsp;dat wenst.&nbsp;24/7 inzetbaar binnen&nbsp;ons&nbsp;verzorgingsgebied West-Europa, Scandianavi&euml; en Engeland.&nbsp;Snel, betrouwbaar transport&nbsp;voor regio Haaglanden, Rotterdam en Belgie. Informeer (ook) bij ons voor al&nbsp; uw sneltransporten of Ad Hoc vervoer van envelop tot trailer.</p>\r\n\r\n<p>Dagelijks, al&nbsp;20 jaar,&nbsp;verzorgen wij nachttransporten binnen Nederland, van deelzendingen tot full truckloads, evenals dedicated transports.</p>\r\n\r\n<p>Dankzij ons gevarieerd jong&nbsp;wagenpark en gekwalificeerd personeel worden uw goederen correct, op tijd&nbsp;en met de nodige omzichtigheid ter plaatse gebracht.<br />\r\n&nbsp;</p>\r\n\r\n<p>Onze voertuigen zijn voorzien van de meeste geavanceerde communicatie middelen. De chauffeurs hebben jaren lange ervaring met nachtritten. dat is ook de reden dat wij een constante top prestatie kunnen leveren.<br />\r\nKoerier Centrum Haaglanden rijdt met NIWO vergunning en onze rijders zijn ADR gecertificeerd.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Koerier Centrum Haaglanden is medio 2014 gestart met de dienst&nbsp;<strong>City Service Den Haag &amp; Delft</strong> . Deze sneldienst is voor bedrijven en particulieren.&nbsp;Kosten per pakket zijn incl. afhaalkosten. Uw zending kunt u ook bij ons depot brengen, dat bespaart ophaalkosten.</p>\r\n\r\n<p>Een onderdeel van deze dienst is de <strong>webshopkoerier</strong>, waarbij webshophouders in de regio Haaglanden en Rotterdam&nbsp;gebruik kunnen maken van onze vervoersmogelijkheden. Een vast prijs per zending naar uw klanten.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '''s-Gravenzandseweg 62 A', '2291 PE', 'WATERINGEN', 'Zuid-Holland', 'www.koerierdienst.nl', '+31 (0) 88-3655050', '', '25, 26, 27, 2, 28, 29', 'ADR transport, Koeriersdienst, Nachtdistributie, Same Day Delivery, Scheepsleveringen, World Wide Ex', '', '', 'F.B. van der  Veen', 7, '', 'EUR', '', 'planning@koerierdienst.nl', 'gold', 'Foto1 KCH.jpg', 'Logo KCH.png', 'Foto2 KCH.jpg', 1, 'Transport'),
