(3009, 'KDZ Express B.V.', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>KDZ Express is uw betrouwbare partner op het gebied van nationale en internationale express- en koeriersdiensten.</p>\r\n\r\n<p><strong>Wereldwijde koeriers voor uw zending</strong><br />\r\nVia ons wereldwijde netwerk bezorgen wij uw pakketten en documenten overal. Natuurlijk bezorgen wij uw zending binnen Nederland de volgende dag. Daarnaast leveren we binnen 24 uur naar alle belangrijke businesscentra in Europa. In de belangrijkste gebieden in Azi&euml;, Afrika en Amerika wordt binnen 48 uur geleverd en in de rest van de wereld snel daarna.</p>\r\n\r\n<p><strong>Eenvoudig online </strong><br />\r\nHet boeken, klaarmaken en verzenden van een pakket of document gaat bij KDZ Express vlot. In enkele muisklikken is uw zending aangemeld. De koerier haalt de zending bij u op wanneer u dat wilt. U blijft door middel van Track &amp; Trace altijd op de hoogte van de status van uw zending.</p>\r\n\r\n<p><strong>Uw voordeel</strong><br />\r\n&bull;&nbsp;&nbsp; &nbsp;Nationale en internationale koeriersdiensten<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Snel en betrouwbaar<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Eenvoudig online boeken<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Online Track &amp; Trace<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Zelf bepalen waar de koerier uw zending ophaalt</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Prestwickweg 16', '1118 LB', 'SCHIPHOL-AIRPORT', 'Noord-Holland', 'www.kdz.com', '+31 (0) 85-4875000', '', '53, 16, 54, 55, 1, 1', ', Economy Service, Priority Express, Special Services, Luchtvracht', '', '', 'J.C. den Uijl', 1, '', 'NAT', '', 'nl.ops@kdz.com', 'gold', 'foto2 kdz.JPG', 'logo-kdz.png', 'foto1 kdz.JPG', 1, 'Transport'),
