(4173, 'ZUIDWEST Logistiek', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ZUIDWEST logistiek levert duurzame, optimale en inventieve logistieke diensten. Door continue te werken aan procesverbeteringen en inventieve oplossingen cre&euml;ren we hiermee nadrukkelijk een meerwaarde voor onze klanten. Het stelt ons in staat de klant totaal te ontzorgen.&nbsp;</p>\r\n\r\n<p>ZUIDWEST logistiek blijft de specialismen van de organisatie ontwikkelen en heeft de ambitie om uit te groeien tot de meest toonaangevende en inspirerende full-service logistieke dienstverlener van Zuidwest Nederland.&nbsp;Onze manier van werken kent een stevig fundament van belangrijke kernwaarden.<br />\r\n<br />\r\n<strong>ZUIDWEST logistiek is: </strong></p>\r\n\r\n<ul>\r\n	<li><strong>Open</strong><br />\r\n	Een open en eerlijke communicatie vormt de basis van iedere op vertrouwen gebaseerde samenwerking.<br />\r\n	&nbsp;</li>\r\n	<li><strong>Gedreven</strong><br />\r\n	In ons werk doen wij alles met volle overtuiging en aandacht voor detail.&nbsp;<br />\r\n	&nbsp;</li>\r\n	<li><strong>Flexibel</strong><br />\r\n	Wij passen ons gemakkelijk aan wisselende omstandigheden aan.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', 'Amundsenweg 45', '4462 GP', 'GOES', 'Zeeland', 'www.zuidwestlogistiek.nl', '+31 (0) 113-222020', '+31 (0) 113-233778', '10, 21, 8, 26, 2, 52', 'ADR transport, Distributie, Sneltransport, Koel/Vries, Nachtdistributie, Dedicated Transport', '', '', 'J.G.  Hoogerland', 27, 'VOF', 'EUR', '', 'info@zuidwestlogistiek.nl', 'gold', 'Banner Zuidwest.JPG', 'Logo zuidwestlogistiek.png', 'Foto Zuidwest.JPG', 1, 'Transport'),
