(5337, 'Vos Logistics Oss B.V.', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Vos Logistics is een onafhankelijke, Europese logistieke dienstverlener en levert een breed scala aan transport- en klantspecifieke logistieke diensten. Het bedrijf heeft vier kernactiviteiten:</p>\r\n\r\n<ul>\r\n	<li><a href="http://www.voslogistics.com/onze%20diensten/cargo/profiel">Cargo</a> bestaat uit het vervoeren van verpakte goederen. Haar activiteiten bestaan hoofdzakelijk uit volle truckladingen, deelladingen en intermodaal transport. Vos Logistics dient diverse markten, waaronder de automotive, consumentenelektronica, retail en bouwindustrie.</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>&nbsp;<a href="http://www.voslogistics.com/onze%20diensten/bulk/profiel">Bulk</a> bestaat hoofdzakelijk uit het transport van droge onverpakte goederen (zowel granulaten als poeders). De producten omvatten chemicali&euml;n, levensmiddelen, diervoeders, zetmeel, mineralen, ADR en afval. In de chemische industrie is Vos Logistics een specialist in vrachtmanagement, het managen van goederenstromen vanaf diverse productielocaties. Daarnaast levert Bulk opslag-,&nbsp;verpakkings- alsook EFTCO tank cleaning diensten.</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li><a href="http://www.voslogistics.com/onze%20diensten/logistics%20services/Profiel">Logistic Services</a> biedt klantspecifieke, logistieke oplossingen van&nbsp;transport, opslag,&nbsp;value added services en distributie tot complete full supply chain oplossingen, waarbij Vos Logistics het beheer van de goederenstromen van de klant volledig of deels overneemt.</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li><a href="http://www.voslogistics.com/onze%20diensten/fleet%20management/profiel">Fleet Services</a> biedt effici&euml;nte transport- en distributieoplossingen aan bedrijven met haar eigen wagenpark en biedt ondersteuning&nbsp;met&nbsp;analyses van transportbehoeften, wagenparkfinanciering, vervanging en verkoop van gebruikte equipement, preventief onderhoud, brandstofoptimalisatie, verzekeringen, beheer van seizoensgebonden invloeden, werving en selectie, trainen van personeel en&nbsp;het aansturen&nbsp;van chauffeurs.</li>\r\n</ul>\r\n\r\n<p>Distributie, Intermodaal vervoer, Diefstal gevoelig vervoer, FTL/LTL, FCL/LCL</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Waalkade 4', '5347 KS', 'OSS', 'Noord-Brabant', 'www.voslogistics.com', '+31 (0) 412-699599', '+31 (0) 412-699943', '8, 45, 46, 47, 48, 1', ', Distributie, Intermodaal Vervoer, Diefstal Gevoelig Vervoer, FTL/LTL, FCL/LCL', '', '', 'A.J.B. van  Bergen', 16, '', 'EUR', '', 'logistics.services@voslogistics.com', 'gold', 'rsz_1banner.jpg', 'Logo Vos.JPG', 'Foto Vos.jpg', 1, 'Transport'),
