(5446, 'Van den Heuvel Logistiek B.V.', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Van den Heuvel is een betrouwbare partner voor alle zaken die te maken hebben met uw vervoer- en opslagbehoeften. We denken en werken graag mee aan de voor u meest&nbsp;geschikte oplossingen op logistiek gebied.</p>\r\n\r\n<p>Ons familiebedrijf bestaat al meerdere generaties en heeft zich sinds 1990 volledig gericht op logistieke werkzaamheden. In de afgelopen 23 jaar is dit uitgegroeid tot een allround transportbedrijf met een wagenpark van ruim 100&nbsp;vrachtwagens in diverse maten en uitvoeringen en meer dan 190 medewerkers.</p>\r\n\r\n<h2><strong>Onze&nbsp;diensten:</strong></h2>\r\n\r\n<ul>\r\n	<li>Distributie</li>\r\n	<li>Transport</li>\r\n	<li>Koeriersdiensten</li>\r\n	<li>Op- en overslag van uw goederen.</li>\r\n</ul>\r\n\r\n<h2><strong>Ondernemer van het jaar / FD Gazellen.</strong></h2>\r\n\r\n<p>In 1999 heeft onze organisatie de titel &ldquo;Ondernemer van het jaar&rdquo; ontvangen en in 2000 is ons bedrijf ook nog eens genomineerd voor de BOV trofee &ldquo;Beste Ondernemers Visie 2000&rdquo;. In 2011 zijn wij&nbsp;finalist geworden in de strijd om de &quot;MVO Award Uden-Veghel-Schijndel&quot;. Sinds eind 2012 behoren wij tot het gezelschap snelst groeiende ondernemingen in Nederland: de door het Financieel Dagblad uitgeroepen FD Gazellen. De FD Gazellen Award wordt uitgereikt aan bedrijven welke een omzetgroei van tenminste 20 procent per jaar gerealiseerd hebben over de laatste 3 jaar. Verder is de absolute voorwaarde dat het bedrijf financieel gezond is. In 2013 hebben wij de Udense Ondernemerspluim in ontvangst mogen nemen!</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Erfstraat 23', '5405 BE', 'UDEN', 'Noord-Brabant', 'www.heuveluden.nl', '+31 (0) 413-339933', '+31 (0) 413-339930', '8, 9, 25, 35, 39, 37', 'Distributie, Transport, Koeriersdienst, Opslag, Logistiek, Overslag', '', '', 'H.W. van den Heuvel', 122, '', 'EUR', '', 'info@heuvellogistiek.nl', 'gold', 'Banner Heuvel.jpg', 'Logo Heuvel.jpg', 'Foto Heuvel.jpg', 1, 'Transport'),
