(5658, 'Das Koerier B.V.', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Welkom bij Das Koerier!</strong><br />\r\nUw partner op het gebied van transport en logisitiek.<br />\r\n<br />\r\nAl meer dan 25 jaar bezorgt Das Koerier wekelijks duizenden zendingen voor haar klanten.<br />\r\nDagelijks halen onze chauffeurs overal in de Benelux zendingen op, die direct als spoed rit, of de volgende dag overal in Nederland en Belgi&euml; worden afgeleverd.<br />\r\n<br />\r\nZowel voor Nationale &ndash; als Internationale Overnight pakketten alsmede voor pallets, heeft Das Koerier een eigen netwerk.<br />\r\nVoor ieder type zending heeft Das Koerier een bus, bakwagen, vrachtwagen of trailer die direct inzetbaar is voor al uw transportopdrachten.<br />\r\n<br />\r\n<strong><em>Das Koerier; Das goed geregeld!</em></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Habraken 2154', '5507 TH', 'VELDHOVEN', 'Noord-Brabant', 'daskoerier.nl', '+31 (0) 40-2538843', '', '10, 38, 14, 15, 1, 1', ', Sneltransport, Palletdistrubutie, Pakketdistributie, Internationaal Transport', '', '', 'J.W.H.  Das', 16, '', 'EUR', '', 'info@daskoerier.nl', 'gold', 'FOTO DAS.jpg', 'Logo DAS.png', 'FOTO2 DAS.jpg', 1, 'Transport'),
