(5813, 'Ritmo Logistics B.V.', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>RITMO&nbsp;is uw partner op het gebied van transport en logistiek management binnen Europa. Wij zijn gespecialiseerd in maat-oplossingen voor uw logistieke uitdagingen. RITMO is een toonaangevend Europees logistiek management bedrijf, gevestigd in Eindhoven. RITMO, opgericht in 1990, heeft ruime ervaring in het beheer van het goederenvervoer. Wij bieden veilig transport, opslag en distributie van uw producten.</p>\r\n\r\n<h2><strong>Daarom Ritmo</strong></h2>\r\n\r\n<p>RITMO heeft een sterke klantfocus. Op basis van uw specifieke eisen zijn wij van toegevoegde waarde bij de invulling van uw logistieke wensen. Een goed voorbeeld is onze &#39;Safe Way to UK&#39;&nbsp; en warehouse services.<br />\r\nRITMO wordt internationaal erkend als &eacute;&eacute;n van de beste expediteurs richting het Verenigd Koninkrijk en Benelux. Express is onze standaard en flexibiliteit onze tweede natuur. Dat is de reden waarom toonaangevende fabrikanten en distributeurs in High Tech, Consumer Electronics en gezondheidszorg, RITMO als hun partner in logistiek management kiezen. Vraag ook naar onze Duitsland oplossing!</p>\r\n\r\n<h2><strong>Gespecialiseerd in&nbsp;distributie en warehousing</strong></h2>\r\n\r\n<p>De belangrijkste redenen om RITMO te kiezen zijn:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Uitgebreide logistieke ervaring, met name in distributie binnen de <a href="mailto:frontoffice@ritmobv.nl?subject=Aanvraag%20Benelux">Benelux</a>,&nbsp;<a href="mailto:frontoffice@ritmobv.nl?subject=Aanvraag%20Duitsland">Duitsland</a>,&nbsp;<a href="mailto:frontoffice@ritmobv.nl?subject=Aanvraag%20Frankrijk">Frankrijk</a>&nbsp;en naar het <a href="mailto:frontoffice@ritmobv.nl?subject=Aanvraag%20UK">Verenigd Koninkrijk </a>Unieke &#39;Safe Way to UK&#39; service</p>\r\n	</li>\r\n	<li>\r\n	<p>Warehousing &amp; Distribution&nbsp;voor o.a. Healthcare&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Veel positieve testimonials</p>\r\n	</li>\r\n	<li>\r\n	<p>Persoonlijke aanpak en sterke focus op de klant</p>\r\n	</li>\r\n	<li>\r\n	<p>Op maat gemaakte logisitieke IT-oplossing</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Pro-actieve, snelle en betrouwbare &#39;tracking&#39; informatie&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n', 'Mispelhoefstraat 11', '5651 GK', 'EINDHOVEN', 'Noord-Brabant', 'www.ritmobv.nl', '+31 (0) 40-2064224', '+31 (0) 40-2624666', '40, 9, 41, 42, 43, 44', 'Transport, Express Service, Groupage, Transport Electronica, Transport UK, Transport Luxe Goederen', '', '', 'H. van Boxtel', 47, '', 'EUR', '', 'frontoffice@ritmobv.nl         ', 'gold', 'Ritmo Banner2.jpg', 'logo_Ritmo.png', 'Foto Ritmo.png', 1, 'Transport'),
