(5947, 'Gebroeders Hoefnagels Transport Asten B.V.', '<p>Gebroeders Hoefnagels is lid van de Bouwvervoer groep. Bouwvervoer is een samenwerkingsverband tussen 7 vervoerders. De deelnemers zijn allen specialisten in bouw en bestratingsmaterialenvervoer en zijn verspreid over Nederland gevestigd.</p>\r\n\r\n<p>Samen beschikken de deelnemende bedrijven over circa 175 kraanwagens. Daarnaast kunnen ook andere voertuigtypen worden ingezet. Bijvoorbeeld: platte wagens en schuifzeilenwagens met kooiaap. In principe is bijna elk gewenst type wagen binnen de groep aanwezig.</p>\r\n\r\n<p>Door de combinatie van een groot beschikbaar volume, specialisatie, regionale/ landelijke dekking en goede grensoverschrijdende mogelijkheden kunnen de klanten van de aangesloten vervoerders rekenen op hoge leveringsbetrouwbaarheid en kwaliteit.</p>\r\n', 'Ommelsveld 5', '5721 VT', 'ASTEN', 'Noord-Brabant', 'http://www.hoefnagelstransport.nl/', '+31 (0) 493-671888', '', '4, 5, 6, 1, 1, 1', 'Bouwmaterialen, Speciaal Transport, Trucking', '', '', 'A.J.  Hoefnagels', 140, '', 'EUR', '', '', 'gold', '', '', '', 1, 'Transport'),
