(6026, 'Verstraaten Express B.V.', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Allround vervoerspartner</strong></p>\r\n\r\n<p>Wij geloven dat de vervoersmarkt beter en effici&euml;nter kan. Een voortdurende zoektocht die bij Verstraaten nooit stil staat. Begonnen in 1949 als taxivervoerder in Zuid-Nederland dagen wij onszelf continu uit.</p>\r\n\r\n<p><strong>Platte organisatie</strong></p>\r\n\r\n<p>De managers van Verstraaten begeven zich dagelijks op de werkvloer. En ze zijn daar in gesprek met collega&rsquo;s en met klanten. Deze persoonlijke betrokkenheid, enorme kennis van de branche en organisatie zorgen voor stabiliteit en continu&iuml;teit.</p>\r\n\r\n<p><strong>Meer doen dan gevraagd</strong></p>\r\n\r\n<p>Onze ondernemersmentaliteit heeft geleid tot aanvullende vervoersdiensten in heel Nederland die onder de vlag van Verstraaten opereren. De business units zijn: Verstraaten&nbsp;Express BV, Verstraaten Staatsie Vervoer BV&nbsp;(VSV) en Postvak50 BV. &nbsp;Business Post is een onderdeel van Postvak50 BV.</p>\r\n\r\n<p><strong>Kwaliteit brengt mensen verder</strong></p>\r\n\r\n<p>Een waarheid waar geen speld tussen te krijgen is. Tegelijkertijd is dit een boodschap waar maar weinig aanbieders in de vervoersbranche daadwerkelijk invulling aan geven.</p>\r\n\r\n<p><strong>Onze beloftes aan u</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>We leveren<strong>&nbsp;kwaliteit</strong>. Overal en altijd. In mensen, processen en in de organisatie.</p>\r\n	</li>\r\n	<li>We vinden&nbsp;<strong>mensen</strong>&nbsp;belangrijk. Goede interactie tussen medewerkers en klanten.</li>\r\n	<li>\r\n	<p>We denken&nbsp;<strong>verder</strong>&nbsp;en leveren toegevoegde waarde. Doen meer dan anderen.&nbsp;</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', 'Ambachtstraat 50', '5804 CD', 'VENRAY', 'Limburg', 'www.verstraatenexpress.nl', '+31 (0) 478-648642', '', '25, 15, 49, 50, 51, 1', ', Pakketdistributie, Koeriersdienst, Geconditioneerd, Medicijn Vervoer, Regioservice', '', '', 'G.J.G.M.  Verstraaten', 10, 'BV', 'EUR', '', 'planning@verstraatenexpress.nl', 'gold', 'banner.jpg', 'Logo Verstraaten.JPG', 'Verstraaten_2012_no_14.jpg', 1, 'Transport'),
