(6450, 'Alexpress', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Koeriersbedrijf Alexpress vult uw specifieke vervoersbehoefte in.</strong></p>\r\n\r\n<p>Ons bedrijf is ontstaan uit de visie dat het ook anders kan. Onze jarenlange ervaring in de logistiek leerde dat de traditionele vervoerders afhaken op het moment dat de vervoersbehoefte niet binnen strakke kaders paste, voor specifieke vervoersbehoeften waren geen oplossingen.</p>\r\n\r\n<p>Het vernieuwde concept van Alexpress biedt die oplossingen wel.<br />\r\nOplossingen voor de in vele bedrijven voorkomende afwijkende vervoersbehoeften, die niet passen binnen bestaande contracten en afspraken met vaak grote vervoerders.<br />\r\nOplossingen voor bedrijven die geen contracten hebben met de &ldquo;grote&rdquo; vervoerders omdat ze te &ldquo;weinig&rdquo; transport aan te bieden hebben.</p>\r\n', 'Kampstraat 70', '6163 HG', 'GELEEN', 'Limburg', 'www.alexpress.nl', '+31 (0) 46-4752384', '+31 (0) 46-4759154', '11, 25, 10, 36, 1, 1', ', Sneltransport, Just in Time, Koeriersdienst, Maatwerk', '', '', 'A.J.G. van den Tillaart', 12, '', 'EUR', '', 'info@alexpress.nl', 'gold', 'banner Alexpress.jpg', 'Logo Alexpress.PNG', '0', 1, 'Transport'),
(6451, 'PD Sneltransport V.O.F.', '', 'Admiraal Helfrichstraat 63', '6163 XL', 'GELEEN', 'Limburg', 'pdsneltransport.nl', '06-30411610', '', '1, 1, 1, 1, 1, 1', '', '', '', 'D.J. van Nooij', 3, '', 'EUR', '', 'info@pdsneltransport.nl', '', '', '', '', 1, 'Transport'),
