(6797, 'DP koeriers', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:rgb(51, 51, 51); font-family:trebuchet ms,sans-serif; font-size:11pt">DP Koeriers is al 15 jaar snel en vertrouwd, onze koeriers zijn snel en betrouwbaar dit maakt DP Koeriers tot de juiste keuze voor bedrijven.<br />\r\n<br />\r\nWij zijn gestart met een nieuwe service &quot; DP 3 uur service &quot; Deze service bieden wij aan voor onze Caddy&#39;s en Vito&#39;s uw zending word binnen 3 uur na afhaling geleverd in heel Nederland met uitzondering van de Wadden eilanden voor 0.50 eurocent per kilometer<br />\r\n<br />\r\nOnze service DP 3 uur service &amp; DP Vandaag zijn de goedkoopste koeriers tarieven in de ruime omgeving van Nijmegen. Koeriers opdrachten al vanaf<br />\r\n&euro; 0,45 eurocent per kilometer. Via ons landelijk netwerk verzorgen wij ook uw overnightzendingen</span><span style="color:rgb(51, 51, 51); font-family:arial,sans-serif; font-size:10pt">.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Edisonstraat 21', '6604 BT', 'WIJCHEN', 'Gelderland', 'www.dpkoeriers.nl', '+31 (0) 24-3480230', '+31 (0) 24-3480229', '25, 64, 27, 17, 59, 1', ', Overnight, Koeriersdienst, Same Day Delivery, Packs, 3-uurs Service', '', '', '', 0, '', '', '', 'info@dpkoeriers.nl', 'gold', 'Banner DP.png', 'Logo DP.png', 'Foto DP.png', 1, 'Transport'),
