(8014, 'Regio Express', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Regio Express is gevestigd op het bedrijvenpark Buitenvaart te Hoogeveen. Door de centrale ligging van dit park, op de kruising van de A37 en A28, is het een prima locatie als start naar u of uw klant.<br />\r\n<br />\r\nOp dit bedrijventerrein hebben we verschillende loodsen voor opslag en distributie, tevens ons wagenpark om onze klanten optimaal van dienst te zijn. Werkzaamheden gebeuren hier de klok rond dus 24 uur per dag worden diverse goederenstromen verwerkt. Omdat niet alleen het nu, maar ook de toekomst belangrijk is besteden we ieder jaar veel tijd en aandacht aan scholing.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Buitenvaart 1905A', '7905 ST', 'HOOGEVEEN', 'Drenthe', 'www.regioexpress.nl', '+31 (0) 528-340510', '', '15, 58, 59, 51, 31, 14', 'Palletdistrubutie, Pakketdistributie, Spoedzendingen, Regioservice, DHL Parcel, Packs', '', '', '', 0, '', '', '', 'info@regioexpress.nl', 'gold', 'Banner Regio Express.JPG', 'logo Regio Express.png', 'Foto Regio Express.JPG', 1, 'Transport'),
