(8352, 'Flevobird Logistiek B.V.', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Professioneel, service- en klantgericht, 24 uur per dag, 7 dagen per week, zijn enkele sleutelwoorden voor ons succes. Sinds 1985, zijn wij inmiddels uitgegroeid tot een logistiekbedrijf in al haar facetten en mogelijkheden. Onze grote groep van vaste en parttime medewerkers is uw garantie voor het op tijd verzenden, handlen of ontvangen van al uw producten of pakketten. Betrouwbaar transport met onze auto&#39;s of met uw eigen bestelauto, ...lokaal, regionaal, nationaal of internationaal. Graag geven wij u een beeld van onze uitgebreide mogelijkheden.</p>\r\n\r\n<p>Flevobird beschikt over een groot en modern wagen park van bestelwagens, bestelbussen, BE combinaties, BE-oplegger en vele koeriers auto&#39;s eventueel met aanhangwagen. Naast onze nationale en internationale koeriersdiensten, 24 uur per dag, kunnen wij uw partner zijn in stadsbezorgingen, postrondes en/of klantgerichte rondes, bijvoorbeeld voor instellingen, inkoopcombinaties en postorderbedrijven. Onze service en klantgerichtheid zijn uniek. Uw envelop, pakket of pallet(s) worden door ons absoluut op de afgesproken tijd gehaald of bezorgd.</p>\r\n\r\n<p>Eigen vervoermiddelen maar geen chauffeur? In dat geval leveren wij de bestuurder voor uw bestelauto of kleine vrachtwagen. U bepaalt de route... wij rijden.</p>\r\n\r\n<p>Koeltransport(koerier) is een belangrijk aspect in de food en medicijnen branche. Met name logistiek moet er flexibel kunnen worden gehandeld. Een ingewikkeld en zeer verfijnd proces. Wij rijden met onze koelauto&#39;s voor diverse klanten.</p>\r\n\r\n<p>Koel en vries op- en overslag is aanwezig in het distributiecentrum van Flevobird Logistiek.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Noordersluisweg 40', '8243 PR', 'LELYSTAD', 'Flevoland', 'www.flevobird.nl', '+31 (0) 320-219798', '+31 (0) 320 - 219791', '25, 65, 49, 66, 15, 1', ', Pakketdistributie, Koeriersdienst, Geconditioneerd, Chauffeursdiensten, Handling', '', '', 'H.H.J.J.  Ellen', 13, '', 'EUR', '', 'info@flevobird.nl', 'gold', 'flevobird_478x140.jpg', 'Logo Flevobird.PNG', 'ByNA8nhCMAEUr2o.jpg', 1, 'Transport'),
