(9294, 'A7 Snelkoeriers B.V.', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-family:trebuchet ms,sans-serif; font-size:11pt">Oprichter Remo Sloof begon met zijn koeriersdiensten in januari 1996. Al snel kwam Remo in contact met Rene Nijenbrinks. In September 1996 besloten ze samen te gaan werken, waarbij&nbsp;Rene A7 Snelkoerier overnam en Remo zich meer ging focussen op het operationele gedeelte.&nbsp;</span></p>\r\n\r\n<p><strong><span style="font-size:18px"><span style="font-family:trebuchet ms,sans-serif">Na 10 jaar groei.</span></span></strong></p>\r\n\r\n<p><span style="font-family:trebuchet ms,sans-serif; font-size:11pt">Na 10 jaar hard werken, is A7 Snelkoerier uitgegroeid tot een sterke naam in het logistieke segment. In 1996 begonnen als eenmanszaak, in 2006 uitgegroeid tot een gerespecteerd bedrijf met meer dan 50 medewerkers, vele tevreden klanten en een groei van 20% per jaar.</span></p>\r\n\r\n<p><span style="font-family:trebuchet ms,sans-serif; font-size:11pt">A7 Snelkoerier verzorgt inmiddels naast spoedzendingen ook nachtafleveringen en palletvervoer.</span></p>\r\n\r\n<p><span style="font-family:trebuchet ms,sans-serif; font-size:11pt">De nieuwe locatie aan de Poolsterweg biedt klanten nu ook de mogelijkheid tot &nbsp;op- en overslag.&nbsp;</span></p>\r\n\r\n<p><span style="font-family:trebuchet ms,sans-serif; font-size:11pt">Lokaal en regionaal is het bedrijf inmiddels zeer bekend.&nbsp;</span></p>\r\n\r\n<p><span style="font-family:trebuchet ms,sans-serif; font-size:11pt">Ten tijde van het 10-jarige bestaan in 2006, werd A7 Snelkoerier aangepast aan het internet tijdperk en werd de naam gewijzigd in A7-Snelkoerier.nl. Dit verbeterde onder meer de vindbaarheid.&nbsp;</span></p>\r\n\r\n<p><span style="font-family:trebuchet ms,sans-serif; font-size:11pt">Sindsdien hebben de ontwikkelingen niet stilgestaan. De organisatie is groter, bekender en professioneler geworden en de naam A7-Snelkoerier.nl dekt, om in transporttermen te blijven,&nbsp;de lading niet meer.</span></p>\r\n\r\n<p><span style="font-family:trebuchet ms,sans-serif; font-size:11pt">Ook in 2014 groeit a7-snelkoerier door. Hierbij hoort verandering en volwassen worden.&nbsp;</span></p>\r\n\r\n<p><span style="font-family:trebuchet ms,sans-serif; font-size:11pt">Daarom hebben wij gekozen voor een imago verandering.&nbsp;</span></p>\r\n\r\n<p><span style="font-family:trebuchet ms,sans-serif; font-size:11pt">Van het petje achterover en alleen spoedzendingen leveren, zijn wij uitgegroeid tot een waardig diensten pakket en kunnen wij tegenwoordig eigenlijk alles wat u wilt verzenden over de hele wereld bezorgen. Daarom presenteren wij u met trots ons nieuwe logo en imago.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Poolsterweg 9', '9641 MP', 'VEENDAM', 'Groningen', 'a7logistics.nl', '+31 (0) 598-630807', '', '31, 32, 33, 34, 35, 36', 'Spoedzendingen, Pakketten en Documenten, Pallet en Vracht, Innight Distributie, Opslag, Maatwerk', '', '', 'R.M.  Nijenbrinks', 16, '', 'EUR', '', 'info@a7logistics.nl', 'gold', 'A7 Foto2.png', 'A7-Logo.png', 'A7 foto3.png', 1, 'Transport'),
