(9601, 'DGO Express', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>DGO Express is een logistieke dienstverlener in het noorden van het land. Met ruim 80 voertuigen en 130 deskundige medewerkers zijn wij gespecialiseerd in fijnmazige 24-uurs distributie binnen Nederland, Belgi&euml; en Luxemburg.<br />\r\nOns logistieke centrum is gevestigd in Hoogeveen aan de A28, waar wij beschikking hebben over ruim 8000 m&sup2;&nbsp;crossdocking.<br />\r\n<br />\r\nAl sinds de oprichting van het bedrijf, ruim 70 jaar geleden, heeft DGO Express naam gemaakt als zeer dynamische en betrouwbare logistieke partner. Onze belangrijkste kracht is dat wij luisteren naar onze klanten en met de informatie ook daadwerkelijk het bedrijf optimaliseren, getuige onze ISO 9001 certificering.<br />\r\n<br />\r\nOnze lijnen naar de klant zijn zo kort mogelijk. Klanten hebben hun eigen contactpersoon. Bovendien is er een speciale afdeling waar nieuwe klanten en klanten met speciale wensen terecht komen. Hierdoor wordt extra en rechtstreeks aandacht besteed aan de vormen van vervoer die iets minder routinematig zijn.<br />\r\nKortom, geen bedrijf zal bij DGO Express tussen wal en schip belanden. Wij zijn 24 uur per dag geopend en onderweg voor u!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'de Stroom 6-8', '7901 TE', 'HOOGEVEEN', 'Drenthe', 'www.dgoexpress.nl', '+31 (0) 528-227800', '+31 (0) 528-272732', '37, 8, 15, 7, 56, 57', 'Warehousing, Distributie, Pakketdistributie, Logistiek, Verhuizingen, Distri-XL', '', '', '', 0, '', '', '', '', 'gold', '5286255.jpg', 'Logo DGO.JPG', 'Foto1 DGO.jpg', 1, 'Transport'),
